    false,nt"url": null,nt"notes": "To determine nutrient levels in Back Bay,
    water samples were collected monthly from April, 1986 through March, 1987. Surface
    water samples were collected at six stations (Figure 1) and sent to the Virginia
    Consolidated Laboratory for analyses. Parameters monitored by the State Lab were
    suspended solids (total, volatile and fixed), ammonia, nitrite, nitrate, total Kjeldalh
    nitrogen and phosphorus (total and ortho). Other parameters which were monitored
    in the field at the time of the collection weresalinity, conductivity, water temperature,
    Secchi disc transparency, pH and turbidity. These results were reported by Norman
    and Southwick (1987).",nt"license_title": "License Not Specified",nt"extras":
